import React, { useState, useEffect } from "react";
import { View, StyleSheet } from "react-native";
import { Searchbar, Button } from "react-native-paper";
import Axios from "axios";

const SearchBar = () => {
  const [query, setQuery] = useState("");

  useEffect(() => {
    console.log(query);
  }, [query]);

  const options = {
    method: "GET",
    url: "https://v1-sneakers.p.rapidapi.com/v1/brands",
    headers: {
      "X-RapidAPI-Host": "v1-sneakers.p.rapidapi.com",
      "X-RapidAPI-Key": "bd75c5ae46msh713da5227fac531p1b7198jsn0c89e8416f59"
    }
  };

  // Axios.request(options)
  //   .then((response) => {
  //     console.log(response.data);
  //   })
  //   .catch((error) => console.log(error));

  const ApiCall = () => {
    fetch("https://v1-sneakers.p.rapidapi.com/v1/brands", {
      method: "GET",
      headers: {
        "X-RapidAPI-Host": "v1-sneakers.p.rapidapi.com",
        "X-RapidAPI-Key": "bd75c5ae46msh713da5227fac531p1b7198jsn0c89e8416f59"
      }
    })
      .then((response) => response.json())
      .then((response) => {
        console.log(response.content);
        console.log(response.originator.name);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  return (
    <View style={styles.searchContainer}>
      <Searchbar
        style={styles.searchBar}
        placeholder="Search for sneakers"
        onChangeText={(q) => setQuery(q)}
        value={query}
      />
      <Button onClick={ApiCall}>make call</Button>
    </View>
  );
};

const styles = StyleSheet.create({
  searchContainer: {
    flex: 1,
    width: "100%",
    alignItems: "center"
  },
  searchBar: {
    width: "90%",
    backgroundColor: "#fff",
    shadowColor: "f8f8f8",
    shadowOpacity: 0,
    borderRadius: 6
  }
});

export default SearchBar;
